import Mobile from "./Mobile";

import React from 'react'

const Mobiles = [
  {
  image: "https://rukminim2.flixcart.com/image/312/312/xif0q/mobile/4/h/e/-original-imagzjhwmsamexfk.jpeg?q=70",
  title: "vivo T2x 5G",
  brand: "By Vivo",
  price: "10000",
},
{
  image: "https://rukminim2.flixcart.com/image/416/416/xif0q/mobile/a/o/z/nord-ce-3-lite-5g-ce2099-oneplus-original-imagzj3wqxzgquah.jpeg?q=70",
  title: "OnePlus Nord CE 3 Lite 5G",
  brand: "By OnePlus",
  price: "15000",
},
]

const MobileLists = () => {

   return (
    <>

      <Mobile 
      image={Mobiles.image} 
      title={Mobiles.title} 
      brand={Mobiles.brand} 
      price={Mobiles.price} 
      />
    </>
   );
};

export default MobileLists
